BEGIN;
INSERT INTO `markdown` (`title`, `id`, `md`, `html`) VALUES ('静态分析', '054ff969-3c4d-48a5-9c5b-adf7d4dfcdf0', '# 123\n![0001.jpg](http://127.0.0.1:3001/static/20220706165554_87.jpg)\n\n> 1是不是', '<h1><a id=\"123_0\"></a>123</h1>\n<p><img src=\"http://127.0.0.1:3001/static/20220706165554_87.jpg\" alt=\"0001.jpg\" /></p>\n<blockquote>\n<p>1是不是</p>\n</blockquote>\n');
INSERT INTO `markdown` (`title`, `id`, `md`, `html`) VALUES ('语法分析', '805c729f-cb1f-4857-a6d9-cc0474cbd21b', '**概念**\n语法分析是编译过程的一个逻辑阶段。语法分析的任务是在词法分析的基础上将单词序列组合成各类语法短语，如“程序”，“语句”，“表达式”等等.语法分析程序判断源程序在结构上是否正确。源程序的结构由上下文无关文法描述.语法分析程序可以用YACC等工具自动生成。\n完成语法分析任务的程序称为语法分析器，或语法分析程序。按照源语言的语法规则，从词法分析的结果中识别出相应的语法范畴，同时进行语法检查。\n#### 方法\n - 自上而下语法分析方法\n - 自下而上语法分析方法 \n#### 功能\n按照源语言的语法规则，从词法分析的结果中识别出相应的语法范畴，同时进行语法检查。\n#### 构造元素\n1. 源程序串 （L1形式）\n2. 源语言的文法G  \n3. 识别出的语法范畴的表示 \n#### 图片展示\n![语法分析.png](http://127.0.0.1:3001/static/20220706204912_29.png) \n#### [教学ppt入口](https://hxuhack.github.io/lecture/compiler)', '<p><strong>概念</strong><br />\n语法分析是编译过程的一个逻辑阶段。语法分析的任务是在词法分析的基础上将单词序列组合成各类语法短语，如“程序”，“语句”，“表达式”等等.语法分析程序判断源程序在结构上是否正确。源程序的结构由上下文无关文法描述.语法分析程序可以用YACC等工具自动生成。<br />\n完成语法分析任务的程序称为语法分析器，或语法分析程序。按照源语言的语法规则，从词法分析的结果中识别出相应的语法范畴，同时进行语法检查。</p>\n<h4><a id=\"_3\"></a>方法</h4>\n<ul>\n<li>自上而下语法分析方法</li>\n<li>自下而上语法分析方法</li>\n</ul>\n<h4><a id=\"_6\"></a>功能</h4>\n<p>按照源语言的语法规则，从词法分析的结果中识别出相应的语法范畴，同时进行语法检查。</p>\n<h4><a id=\"_8\"></a>构造元素</h4>\n<ol>\n<li>源程序串 （L1形式）</li>\n<li>源语言的文法G</li>\n<li>识别出的语法范畴的表示</li>\n</ol>\n<h4><a id=\"_12\"></a>图片展示</h4>\n<p><img src=\"http://127.0.0.1:3001/static/20220706204912_29.png\" alt=\"语法分析.png\" /></p>\n<h4><a id=\"ppthttpshxuhackgithubiolecturecompiler_14\"></a><a href=\"https://hxuhack.github.io/lecture/compiler\" target=\"_blank\">教学ppt入口</a></h4>\n');
INSERT INTO `markdown` (`title`, `id`, `md`, `html`) VALUES ('智能指针', '9051d7f8-6d88-40f1-8ab1-6cccd2e76f02', '# 这是\n### 智能指针\n*显示内容*\n[我是一个链接](www.baidu.com)\n|column1|column2|column3|\n|-|-|-|\n|content1|content2|content3|\n![0002.jpg](http://127.0.0.1:3001/static/20220707224648_95.jpg)\n', '<h1><a id=\"_0\"></a>这是</h1>\n<h3><a id=\"_1\"></a>智能指针</h3>\n<p><em>显示内容</em><br />\n<a href=\"www.baidu.com\" target=\"_blank\">我是一个链接</a></p>\n<table>\n<thead>\n<tr>\n<th>column1</th>\n<th>column2</th>\n<th>column3</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>content1</td>\n<td>content2</td>\n<td>content3</td>\n</tr>\n</tbody>\n</table>\n<p><img src=\"http://127.0.0.1:3001/static/20220707224648_95.jpg\" alt=\"0002.jpg\" /></p>\n');
INSERT INTO `markdown` (`title`, `id`, `md`, `html`) VALUES ('代码生成', '990eb667-6573-4d9e-b8cc-6df34a4913fb', '++复旦++\n~大学~\n::: hljs-left\n\n计算机\n\n:::\n::: hljs-right\n\n学院![1E95CEFDAF214ED9C22364C8B1AFB029.png](http://127.0.0.1:3001/static/20220706171959_20.png)\n\n:::\n', '<p><ins>复旦</ins><br />\n<sub>大学</sub></p>\n<div class=\"hljs-left\">\n<p>计算机</p>\n</div>\n<div class=\"hljs-right\">\n<p>学院<img src=\"http://127.0.0.1:3001/static/20220706171959_20.png\" alt=\"1E95CEFDAF214ED9C22364C8B1AFB029.png\" /></p>\n</div>\n');
